          {renderRow(indexPath.E.desc, indexPath.E.values, 'E', indexPath.E.Unit)}
          {/* {renderRow(indexPath.SIZE.desc, indexPath.SIZE.values, 'SIZE', indexPath.SIZE.Unit)} */}
